import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav, Container, Button } from 'react-bootstrap';
import './Navbar.cs';
function MyNavbar() {
  const [expanded, setExpanded] = useState(false);

  const closeMobileMenu = () => setExpanded(false);

  return (
    <>
      <Navbar bg="light" expand="lg" expanded={expanded}>
        <Container>
          <Navbar.Brand href="/">React Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" onClick={() => setExpanded(expanded ? false : "expanded")} />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link as={Link} to="/" onClick={closeMobileMenu}>Home</Nav.Link>
              <Nav.Link as={Link} to="/services" onClick={closeMobileMenu}>Services</Nav.Link>
              <Nav.Link as={Link} to="/products" onClick={closeMobileMenu}>Products</Nav.Link>
            </Nav>
            <Nav className="ms-auto">
              <Button variant="primary" as={Link} to="#" onClick={closeMobileMenu}>Login</Button>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </>
  );
}

export default MyNavbar;
